import { View, Text } from "react-native";
import { AntDesign } from "@expo/vector-icons";
import theme from "../../styles/theme";
import { dayWorkoutStyles } from "../../styles/pages";
import useDate from "../../hooks/useDate";

const DateNavigation = () => {
    const { detailDate } = useDate();

    return (
        <View>
            <View style={dayWorkoutStyles.dateNavigation}>
                <AntDesign name="caretleft" size={24} color={theme.fontColor1} onPress={() => console.log(1)}/>
                <Text style={dayWorkoutStyles.dateNavigationText}>{detailDate}</Text>
                <AntDesign name="caretright" size={24} color={theme.fontColor1}/>
            </View>
        </View>
    );
}

export default DateNavigation;
